If these patterns are bad habits, then you may want to take stock of how you feel at this time of day. In many cases, your habits are a signal of how you feel. Bored? Maybe your afternoon snacking habit is a way of breaking up the monotony of the day. Feeling lonely? Maybe your smoking break is a way to connect with fellow co-workers. The point is, if you understand the reason why these habits pop up at the same time each day, then it can become easier to find a new habit to fill the void. Bad habits are replaced, not eliminated.', '', '2020-05-14 21:59:30', 'Best Behavioral Psychology Books', 2);

One theory is that we mentally assign habits to a particular location. This means that all of the current places that youre familiar with (your home, your office, etc.) already have behaviors, habits, and routines assigned to them. If you want to build new habits in these familiar locations, then you need to overcome the cues that your brain has already assigned to that area. Meanwhile, building a new habit in a new location is like having a blank slate. You dont have to overcome any pre-existing triggers.', '', '2020-05-14 22:10:10', 'Simply a response to the environment that surrounds', 2);

How I use it: For over two years, I have used a preceding event to stick with a daily gratitude habit. Each night, when I sit down to eat dinner, I say one thing that I was grateful for that day. (Its worth noting, one reason I believe I have been able to stick with this habit so consistently is because it is so small. The smaller the habit, the easier it is to build into your life.)', '', '2020-05-14 22:12:31', 'Many habits are a response to something', 2);

Unfortunately, although emotions are very common cues for our behavior, I find that they are harder to control and utilize for building good habits. Mostly, I think this is because if you want an emotion to trigger a positive habit, then you often need to be consciously aware of the emotion as you are experiencing it. In other words, you have to be emotional and aware at the same time  and that can be hard to do. Paying attention is a powerful, but difficult, way to build better habits.

How I use it: Im trying to get better about noticing when I am holding tension in my body and experiencing stress. When I do notice that Im feeling particularly stressed, Ill use this emotional state to cue a deep breathing habit.

I like to follow a 3-1-5 breathing pattern: three seconds in, pause for one second, five seconds out. Ill usually repeat this sequence three to five times. I find this little breathing exercise to be a great instant stress reliever. Its particularly useful because you can literally do it anywhere.', '', '2020-05-14 22:13:12', 'In my experience, emotional state is a common cue for bad habits', 2);

As far as I can tell, the best way to make use of this information is to surround yourself with people who have the habits you want to have yourself. As Jim Rohn says, You are the average of the five people you spend the most time with.

How I use it: I''m not a heavy drinker, but nearly every time I go out with friends, I get a drink. Why is that? If I''m not yearning for a beer, why get one? Its simply a response to the environment that I am in and the people I am around. ', '', '2020-05-14 22:16:30', 'Cue 5: Other People', 3);

For example, lets say you want to build a new habit of doing 10 pushups each day at lunch time. You might start by choosing a time-based cue and saying something like, During my lunch break each day, Ill do 10 pushups. This might work, but it''s not very specific. Do you do your pushups at the beginning of your lunch break? At the end? Any time?

Alternatively, you could create a cue around a very specific preceding event that happens right around your lunch break. For example, When I close my laptop to leave for lunch, Ill do 10 pushups. In this case, the very specific action of closing the laptop is a perfect trigger for what to do next (your 10 pushups). There is no mistaking when you should do the new habit and kick off the habit loop.', '', '2020-05-14 22:17:00', 'Before You Choose Your Habit Cue', 3);

