INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (1, 'Time is perhaps the most common way to trigger a new habit. Common morning habits are just one example. Waking up in the morning usually triggers a cascade of habits: go to the bathroom, take a shower, brush your teeth, get dressed, make a cup of coffee, etc.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (2, 'However, location-based cues are not simply things we respond to, they can also be things we create. Multiple research studies by David Neal and Wendy Wood from Duke University have discovered that new habits are actually easier to perform in new locations.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (3, 'When it comes to cues that are useful for building new habits, I find preceding events to be one of the most useful. Once you understand habit stacking you can develop all sorts of ways to tie new habits into preceding events. (Example: When I make my morning cup of coffee, I will meditate for one minute.)
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (4, 'In my experience, emotional state is a common cue for bad habits. For example, you may have a habit of eating when you feel depressed. Or, you may default to online shopping when you feel bored. The emotional states of depression or boredom are triggers for these negative habits.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (5, 'It is probably no surprise to you that the people you surround yourself with can play a role in your habits and behaviors. What may be a surprise is just how big of an impact these people can make. One study in the New England Journal of Medicine found that if your friend becomes obese, then your risk of obesity increases by 57 percent  even if your friend lives hundreds of miles away.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (6, 'No matter what cue you choose for your new habit, there is one important thing to understand. The key to choosing a successful cue is to pick a trigger that is very specific and immediately actionable.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (7, 'Let''s talk about how to apply behavioral psychology to your daily life. In each of the articles below, I break down some behavioral psychology research and share practical ways to put it to use in our daily lives.
INSERT INTO backend.posts (id, description, photo_path, time_creation, title, user_id) VALUES (8, 'The page is a reading list sharing the best books to read in various categories based on many hours of reading and research. Youll find more than 100 good books to read, organized by category.
